function fetchData() {
  fetch('http://localhost:3000/api/v1/jobs/')
  .then(response => {
    if (!response.ok) {
      throw Error('An error occurred. Please try again.')
    }
    return response.json()
  }).then(data => {
    console.log(data);


const position = data.map(position => {
      return `<p>Position: ${data.position}</p>`
    })
    console.log(position)
    document.querySelector("#position").insertAdjacentHTML('afterbegin',"<h4>Position</h4>");


    const time_data = data.shifts.map(position => {
      return `<p>Time Clock: ${position.shifts}</p>`
    })
    console.log(time_data)
    document.querySelector("#app").insertAdjacentHTML('afterbegin',"<h1>Time</h1>");

  }).catch(error => {
    console.log(error)
  });
}

fetchData()
